// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "./VaultBase.sol";
import "../../interfaces/IUniswapV2Router02.sol";


pragma experimental ABIEncoderV2;

contract AccumulatorDistributorVault is VaultBase {
    constructor(Settings _settings, uint256 _maxTokens) public ERC721("test vault", "tv") {
        require(_maxTokens > 1, "CornFi AccumDist Vault: Max Tokens Cannot be Less Than 1");
        settings = _settings;
        maxTokens = _maxTokens;
        owner = msg.sender;

        // Mint a blank strategy to this contract.
        // When referencing 'tokenAmounts[_tokenId][_token]',
        // use '0' for '_tokenId' to keep track of amounts
        // deposited accross all users. This is helpful when
        // implementing advanced strategies. For example, the
        // deposited tokens in the vault are moved to another 
        // protocol like AAVE to earn interest and/or use as
        // collateral.
        orders.push();
        strategies.push();
        _mint(address(this), tokenCounter);
        tokenOpenOrderIds.push();
        tokenCounter++;
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    /**
    * @dev 
    * _tokens[0] = from token
    * _tokens[1] = to token
    *
    * _amounts[0] = {required} starting amount
    * _amounts[1] = {required} buy price (token[0] / token[1]) * 10e8
    * _amounts[2] = {required} sell price (1) (token[1] / token[0]) * 10e8
    * _amounts[3] = {optional} sell price (2) (token[1] / token[0]) * 10e8
    * _amounts[4] = {optional} sell price (3) (token[1] / token[0]) * 10e8
    *
    *       *** sell price (1) < sell price (2) < sell price (3) ***
    *
    * _times = [0] (Not Used)
    */
    function createTrade(address _from, address[] memory _tokens, uint256[] memory _amounts, uint[] memory _times) public onlyController {
        require(tokenCounter < maxTokens, "CornFi AccumDist Vault: Max Tokens Reached");
        // require(_times.length == 1, "CornFi AccumDist Vault: Time Data Max Exceeded");
        // if(_amounts.length > 3) {
        //     require(_amounts[2] > _amounts[3], "CornFi AccumDist Vault: Sell Price Not in Increasing Order");
        // }
        // if(_amounts.length > 4) {
        //     require(_amounts[3] > _amounts[4], "CornFi AccumDist Vault: Sell Price Not in Increasing Order");
        // }

        require(_amounts[0].div(_amounts.length.sub(2)) >= settings.minimumDeposit(_tokens[0]));

        // Trade must remain profitable after including fees
        // uint256 minProfitPercent = _minimumProfitPercent(settings.strategy(_tokens); .txFeePoints());
        // for(uint i = 2; i < _amounts.length; i++) {
        //     require(_amounts[1].mul(1e6).div(_amounts[i]) >= minProfitPercent, "CornFi AccumDist Vault: Minimum Profit Percent Not Met");
        // }

        // Limit sell orders to 3. Deposit amount and buy price occupy
        // the other two elements.
        require(_amounts.length >= 3 && _amounts.length <= 5, "CornFi AccumDist Vault: Invalid Amounts Length");

        // Create the strategy
        _setStrategy(_tokens, _amounts, _times);

        // Transfer deposit amount from user
        IERC20(_tokens[0]).transferFrom(_from, address(this), _amounts[0]);

        IStrategy strat = settings.strategy(_tokens[0]);

        // Deposit fee
        uint256 depositFee = strat.depositFee(_amounts[0]);
        IERC20(_tokens[0]).transfer(settings.Fees(), depositFee);

        // Adjust token amount to include fee
        uint256 amountInWithFee = _amounts[0].sub(depositFee);
        tokenAmounts[tokenCounter][_tokens[0]] = amountInWithFee;

        IERC20(_tokens[0]).approve(address(strat), amountInWithFee);    //
        strat.deposit(address(this), _tokens[0], amountInWithFee);      //

        _createOrder(tokenCounter, 0, [_tokens[0], _tokens[1]], [amountInWithFee, _getAmountOut(_tokens[0], _tokens[1], amountInWithFee, _amounts[1]), 0], _times);

        // Mint the strategy & send to caller
        _safeMint(_from, tokenCounter++);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function fillOrder(address _from, uint256 _orderId, IUniswapV2Router02 _router, address[] memory _path) public onlyController {
        Order memory order = orders[_orderId];
        require(order.timestamp == 0, "CornFi Stop Loss Vault: Order is Inactive");

        settings.strategy(order.tokens[0]).withdraw(address(this), order.tokens[0], order.amounts[0]);      //


        _swap(_from, order, _router, _path);

        IStrategy strat = settings.strategy(order.tokens[1]);

        IERC20(order.tokens[1]).approve(address(strat), orders[order.orderId].amounts[1]);    //
        strat.deposit(address(this), order.tokens[1], orders[order.orderId].amounts[1]);    //

        // Close order, transfer tokens between caller and this contract
        _closeOrderHelper(order.orderId);
        _create(order);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function withdraw(address _from, uint256 _tokenId) public onlyController {
        require(ownerOf(_tokenId) == _from, "CornFi AccumDist Vault: Caller is Not the Token Owner");
        Strategy memory strat = strategies[_tokenId];
        for(uint i = 0; i < strat.tokens.length; i++) {
            if(tokenAmounts[_tokenId][strat.tokens[i]] > 0) {
                settings.strategy(strat.tokens[i]).withdraw(_from, strat.tokens[i], tokenAmounts[_tokenId][strat.tokens[i]]);      //
                // IERC20(strat.tokens[i]).transfer(_from, tokenAmounts[_tokenId][strat.tokens[i]]);
                tokenAmounts[_tokenId][strat.tokens[i]] = 0;
            }
        }
        uint256[] memory orderIds = tokenOpenOrderIds[_tokenId];
        for(uint j = 0; j < orderIds.length; j++) {
            _removeOpenOrder(orderIds[j]);
            orders[orderIds[j]].timestamp = 1;
        }
        delete tokenOpenOrderIds[_tokenId];
        _burn(_tokenId);
    }


    // --------------------------------------------------------------------------------
    // ------------------------------ Internal Functions ------------------------------
    // --------------------------------------------------------------------------------

    function _closeOrderHelper(uint256 _orderId) internal {
        Order memory order = orders[_orderId];

        // Adjust token amounts
        tokenAmounts[order.tokenId][order.tokens[1]] = tokenAmounts[order.tokenId][order.tokens[1]].add(order.amounts[1]);

        // Adjust token amounts
        tokenAmounts[order.tokenId][order.tokens[0]] = tokenAmounts[order.tokenId][order.tokens[0]].sub(order.amounts[0]);

        // Close trade
        orders[_orderId].timestamp = block.timestamp;

        // Remove open order
        _removeOrder(true, _orderId);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function _createOrderHelper(uint256 _tokenId, uint256 _tradeId, address _fromToken, address _toToken, uint256 _amountIn, uint256 _price, uint[] memory _times) internal {
        _createOrder(_tokenId, _tradeId, [_fromToken, _toToken], [_amountIn, _getAmountOut(_fromToken, _toToken, _amountIn, _price), 0], _times);
    }


    function _create(Order memory order) internal {
        // strategies[order.tokenId].amounts.length provides the count of
        // the initial buy amount, buy price, and sell prices. By subtracting
        // 2 from the length, the number of sell prices is determined.
        // The number of sell prices indicates the number of sell orders
        // within a trade. 
        uint256 length = strategies[order.tokenId].amounts.length.sub(2);


        // As orders are added to a trade, 'tradeLength' is incremented.
        // This is done to help determine the parameters of the next order.

        // Only one order is present in the trade. Next order will be the
        // reverse path of the order just filled.
        if(tradeLength[order.tokenId][order.tradeId] == 1) {
            _createOrderHelper(
                order.tokenId, 
                order.tradeId, 
                order.tokens[1], 
                order.tokens[0], 
                order.amounts[1].div(length), 
                strategies[order.tokenId].amounts[tradeLength[order.tokenId][order.tradeId].add(1)], 
                order.times
            );
        }


        // Current trade is complete. Next order is the buy order of a new trade
        else if(tradeLength[order.tokenId][order.tradeId] == strategies[order.tokenId].amounts.length.sub(1)) {
            _createOrderHelper(
                order.tokenId,
                order.tradeId.add(1), 
                order.tokens[1], 
                order.tokens[0], 
                tokenAmounts[order.tokenId][order.tokens[1]], 
                strategies[order.tokenId].amounts[1], 
                order.times
            );
        }


        // Trade still has remaining sell orders to create.
        else {
            _createOrderHelper(
                order.tokenId, 
                order.tradeId, 
                order.tokens[0], 
                order.tokens[1], 
                orders[trades[order.tokenId][order.tradeId][0]].amounts[1].div(length), 
                strategies[order.tokenId].amounts[tradeLength[order.tokenId][order.tradeId].add(1)], 
                order.times
            );
        }
    }


    function _swap(address _from, Order memory order, IUniswapV2Router02 _router, address[] memory _path) internal {
        require(settings.router(address(_router)));
        uint256 lastElement = _path.length.sub(1);

        require(
            _path[0] == order.tokens[0] &&
            _path[lastElement] == order.tokens[1], 
            "CornFi Limit Order Vault: Invalid Path"
        );

        uint256 amountOut = _router.getAmountsOut(order.amounts[0], _path)[lastElement];
        uint256 minAmountOut = settings.slippage(amountOut); 

        require(minAmountOut >= order.amounts[1], "CornFi Limit Order Vault: Insufficent Output Amount");

        IERC20(order.tokens[0]).approve(address(_router), order.amounts[0]);
        uint256 swapAmountOut = _router.swapExactTokensForTokens(
            order.amounts[0], 
            minAmountOut, 
            _path, 
            address(this), 
            now.add(60)
        )[lastElement];

        require(swapAmountOut >= order.amounts[1], "CornFi Limit Order Vault: Insufficent Output Amount");

        IStrategy strat = settings.strategy(order.tokens[1]);

        uint256 fillerFee = strat.fillerFee(order.amounts[1]); 
        IERC20(order.tokens[1]).transfer(_from, fillerFee);


        uint256 txFee = strat.txFee(order.amounts[1]);
        uint256 remainder = swapAmountOut.sub(order.amounts[1]);
        IERC20(order.tokens[1]).transfer(settings.Fees(), remainder.add(txFee));
        orders[order.orderId].amounts[1] = order.amounts[1].sub(fillerFee).sub(txFee);
    }
}
